sys_variable_value.value:
(function execute(inputs, outputs) {
  var i = parseInt(inputs.i)
  var push_start_num = parseInt(inputs.push_start_num)
  var push_num_records = parseInt(inputs.push_num_records)
  var last_record = push_start_num + push_num_records - 1

  //We want to give evaluate_this_record a value of -1 if we're too early, 0 if we're on the first record, 1 if we're in the range, or 2 if we're past the range.
  if (i < push_start_num) { outputs.evaluate_this_record = -1 }
  if (i == push_start_num) { outputs.evaluate_this_record = 0 }
  if (i > push_start_num & i <= last_record) { outputs.evaluate_this_record = 1 }
  if (i > last_record) { outputs.evaluate_this_record = 2 }

  outputs.debug = "" + i + " _ " + push_start_num + " _ " + push_num_records + " _ " + last_record;

  outputs.new_i = i + 1;
})(inputs, outputs);

